import { Button } from 'antd'
import React, { Component } from 'react'
import { connect } from 'react-redux'
import {Card} from 'antd'
import { withRouter } from 'react-router-dom'

class GIReqDetail extends Component {
    render() {
        let {key,fileName} = this.props.location.state || {}
        const title = 'Globla International Proxy Forms Request Detail'
        const extra = (
            <Button type='primary' onClick={this.props.history.goback}>Return</Button>
        )
        return (
            <div>
                <Card title={title} extra={extra}>
                    <span>{key}:{fileName}</span>
                </Card>
            </div>
        )
    }
}

export default connect(
    state => ({}),
    {}
)(withRouter(GIReqDetail))
